using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// The NSURLResponse class encapsulates the metadata associated with the response to a a URL load request in a manner independent of protocol and URL scheme.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSURLResponse_Class/index.html#//apple_ref/occ/cl/NSURLResponse"/>    [iOSVersion(2)]    public class NSURLResponse : NSObject//, AnyObject, NSCoding, NSCopying, NSObjectProtocol, NSSecureCoding    {        /// <summary>        /// Returns an initialized NSURLResponse object with the URL, MIME type, length, and text encoding set to given values.        /// </summary>        /// <param name="URL">The URL for the new object.</param>        /// <param name="MIMEType">The MIME type.</param>        /// <param name="expectedContentLength">The expected content length.This value should be –1 if the expected length is undetermined</param>        /// <param name="textEncodingName">The text encoding name. This value may be nil.</param>        [iOSVersion(2)]        public NSURLResponse(NSURL URL, string MIMEType, int expectedContentLength, string textEncodingName) { }                /// <summary>        /// The expected length of the response’s content. (read-only)        /// </summary>        [iOSVersion(2)]        [Export("expectedContentLength")]        public Int64 ExpectedContentLength { get; private set; }                /// <summary>        /// A suggested filename for the response data. (read-only)        /// </summary>        [iOSVersion(2)]        [Export("suggestedFilename")]        public string SuggestedFilename { get; private set; }                /// <summary>        /// The MIME type of the response. (read-only)        /// </summary>        [iOSVersion(2)]        public string MIMEType { get; private set; }                /// <summary>        /// The name of the text encoding provided by the response’s originating source. (read-only)        /// </summary>        [iOSVersion(2)]        [Export("textEncodingName")]        public string TextEncodingName { get; private set; }                /// <summary>        /// The URL for the response. (read-only)        /// </summary>        [iOSVersion(2)]        public NSURL URL { get; private set; }    }}